import React from "react";

const Profile = (props) =>{
    return(
        <div className={props.player === 1 ? "player1" : "player2"}>
            <div className="pic"><Image></Image></div>
            <h1>Player {props.player}</h1>
            <h2>{props.turn}</h2>
        </div>
    );
}

export default Profile;
